import React from "react";
import "./About myself.css";

const About = () => (
<section id="About">
<div className="Heading">
<h1>ABOUT MYSELF</h1>
<p>Hello, My name is Rameez and i am a Graduate Telecommucation Engineer. I live in Pakistan, Working Experience in Servers side, Networking and Front-End Development.
I create many websites based on different Tech Stack such as HTML5/CSS and JavaScript. Another i create websites based on WordPress (Famous Content Management System.
Now i learn React and creating this web application as you can see it. </p>
<button><a href="" rel="">Want to see my CV?</a></button>
</div>
</section>
);

export default About;
